import Isi from '../../komponen/isi';
import Layout from '../../layout/layouts';

class Data extends React.Component{
            render(){
                return(
                    <Layout>
                    <div class="data" >
                        <section >
                <div id="Bioskop" class="view"><h2>Bioskop</h2> </div>
            <div class="main_bioskop">
                <Isi link="/artikel/[kode]" as="/artikel/Sonic" img="/images/1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Sonic" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Star Wars" img="/images/2.jpg" div="g_2" figure_class="bioskop_1" figcaption_class="" judul="Star Wars" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Mulan" img="/images/3.jpg" div="g_3" figure_class="bioskop_1" figcaption_class="" judul="Mulan" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Jumanji" img="/images/4.jpg" div="g_4" figure_class="bioskop_1" figcaption_class="" judul="Jumanji" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>

                <Isi link="/artikel/[kode]" as="/artikel/Dora" img="/images/1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Sonic" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Avengers" img="/images/2.jpg" div="g_2" figure_class="bioskop_1" figcaption_class="" judul="Star Wars" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/The Box" img="/images/3.jpg" div="g_3" figure_class="bioskop_1" figcaption_class="" judul="Mulan" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/The Jack In The Box " img="/images/4.jpg" div="g_4" figure_class="bioskop_1" figcaption_class="" judul="Jumanji" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>

                <Isi link="/artikel/[kode]" as="/artikel/Scary Movie" img="/images/1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Sonic" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Bloodshot" img="/images/2.jpg" div="g_2" figure_class="bioskop_1" figcaption_class="" judul="Star Wars" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Maleficent" img="/images/3.jpg" div="g_3" figure_class="bioskop_1" figcaption_class="" judul="Mulan" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Rumble" img="/images/4.jpg" div="g_4" figure_class="bioskop_1" figcaption_class="" judul="Jumanji" starting="Starting from" harga="Rp. 35.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>

                </div></section>  
                    </div></Layout>
                )
            }
        }
     
        export default Data;
